          "title": "NOTTE IN UN NEGOZIO DI GIOCATTOLI: Dormiamo e Giochiamo in Famiglia GBR",
          "description": "Nel nuovo video della Famiglia GBR di oggi passiamo una notte in un negozio di giocattoli tutto per noi.\n\nPer questo ringraziamo Ivan e Rosa e tutta Magicabula Giocattoli che ci hanno letteralmente lasciati le chiavi della loro casa. Li abbiamo cos aiutati a recuperare i dinosauri che ogni notte scappano dal loro scaffale e abbiamo approfittato di giocare come pazzi.\n\nCi hanno portato anche una tipica cena modenese con tigelle e gnocchi fritti, deliziosa. Dopo aver completato la missione, Matilde e Nicol si sono divertiti con i quad mentre noi grandi abbiamo utilizzato uno spettacolare mezzo a pedali. E poi abbiamo fatto una sfilata divertente e giocato a Mostrocchio, un gioco da tavolo veloce e super coinvolgente.\n\nIn questo nuovo video GBR:\n\n00:00 Prendiamo le Chiavi del Negozio\n01:23 Missione Recupero Dinosauri\n09:44 Arriva la Cena\n15:00 Giro con i Quad\n19:09 Prepariamo i Lettini per Dormire\n20:55 Sfilata Pazza con i Giochi\n23:36 Giochiamo a Mostrocchio\n29:18 Risveglio e Colazione\n\nGuarda tutte le nostre avventure della Famiglia GBR qui https://www.youtube.com/watch?v=3_rmrtOqLIc&list=PLgV0ZABrg4jlR1rpIVOL5n3HZg3VWAL6G&index=1\n\n#famigliagbr #giochi #giocattoli \n\nIscriviti al canale GBR per non perdere i prossimi giochi in video https://www.youtube.com/user/giochibambini?sub_confirmation=1"
